import React from "react";
import characters from "../json/Characters.json"
import "./styles/CharactersPage.css"

const CharactersPage = () => {

    const headerRow = () => {
        return (
            <tr>
                <th>Character</th>
                <th>HP</th>
                <th>STR</th>
                <th>MAG</th>
                <th>DEX</th>
                <th>SPD</th>
                <th>DEF</th>
                <th>RES</th>
                <th>LCK</th>
                <th>BLD</th>
            </tr>
        )
    }
    return (
        <main>
            <table className="characterList">
                <thead>
                    {headerRow()}
                </thead>
                <tbody>
                    {characters.map((character, index) => {
                        return (
                            <tr>
                                <th>{character.name}</th>
                                <td>{character.hp}</td>
                                <td>{character.str}</td>
                                <td>{character.mag}</td>
                                <td>{character.dex}</td>
                                <td>{character.spd}</td>
                                <td>{character.def}</td>
                                <td>{character.res}</td>
                                <td>{character.lck}</td>
                                <td>{character.bld}</td>
                            </tr>
                        )
                    })}
                </tbody>
            </table>
        </main>
    )
}

export default CharactersPage
